import React from 'react';
import { Box, Typography } from '@material-ui/core';
const View = () => {
    return (
        <>
            <Box>
                <Typography
                    variant='h3'
                    align='center'
                    className={classes.header}
                >Crud Operation in React </Typography>
            </Box>
        </>
    );
};

export default View;
